import React from 'react'
import styled from 'styled-components';

const Text = styled.span`
  font-size : 20px;
  padding: 0 20px 0 20px;
`;

function MyPage1() {
    return (
        <>
            <span></span>
            <Text>이름 <br /><br /></Text>
            <Text>핸드폰 <br /><br /></Text>
            <Text>이메일 <br /><br /></Text>
        </>
    )
}

export default MyPage1
